class NegociacaoController{constructor(){let t=document.querySelector.bind(document);this._inputData=t("#data"),this._inputQuantidade=t("#quantidade"),this._inputValor=t("#valor")}adiciona(t){t.preventDefault(),alert("Ação realizada com sucesso."),console.log(typeof this._inputData),console.log(this._inputData);let a=new Date(this._inputData.value.split("-"));console.log("Data com split: "+a);let e=new Date(this._inputData.value.replace(/-/,","));console.log("Data com replace: "+e);let o=new Date(...this._inputData.value.split("-").map(function(t,a){return t-a%2}));console.log("Data com map e indice (% -modulo de 2): "+o);let l=new Date(...this._inputData.value.split("-").map((t,a)=>t-a%2));console.log("Data Arrow Functions: "+l);let i=new Negociacao(l,this._inputQuantidade.value,this._inputValor.value);console.log(i)}}